import React from "react";

export default function Navbar() {
  return (
    <div className="nav-bar">
      <h1>Startup 3</h1>
      <ul>
        <button>Overview</button>
        <button>Prices</button>
        <button>Blog</button>
        <button>Feedback</button>
        <button>Purchase</button>
      </ul>
    </div>
  );
}
